import axios from "axios";
import React, { useEffect, useRef } from "react";
import styled from "styled-components";
import { toast } from "react-toastify";


const FormContainer = styled.form`
    display: flex;
    align-items: flex-end;
    gap: 10px;
    flex-wrap: wrap;
    background-color: #fff;
    padding: 20px;
    box-shadow: 0px 0px 5px #ccc;
    border-radius: 5px;
`;

const InputArea = styled.div`
    display: flex;
    flex-direction: column;
`;

const Input = styled.input`
    width: 145px;
    padding: 0 10px;
    border: 1px solid #bbb;
    height: 40px;
    cursor: text;
`;

const Button = styled.button`
    padding: 10px;
    cursor: pointer;
    border-radius: 5px;
    border: none;
    background-color: #2c73d2;
    color: white;
    height: 42px;
`;

const Label = styled.label``;

const Form = ({ getUsers, onEdit, setOnEdit }) => {
    const ref = useRef(); // Armazena valores mutáveis sem causar uma nova renderização quando os valores mudam.

    useEffect(() => {
        if (onEdit && ref.current) {
            const user = ref.current;
            user.nome.value = onEdit.nome || '';
            user.email.value = onEdit.email || '';
            user.senha.value = onEdit.senha || '';
            user.telefone.value = onEdit.telefone || '';
            user.data_nasc.value = onEdit.data_nasc || '';
        }
    }, [onEdit]);
    
    const handleSubmit = async (e) => {
        e.preventDefault();

        const user = ref.current;
        
        if (                        // Verifica se os campos estão preenchidos
            !user.nome.value ||
            !user.email.value ||
            !user.senha.value ||
            !user.telefone.value ||
            !user.data_nasc.value
        ) {
            return toast.warn("Preencha todos os campos!");
        }

        if (onEdit) {               // Verifica se o submit foi de uma edição
            await axios
                .put("http://localhost:8800/" + onEdit.id,{
                    nome: user.nome.value,
                    email: user.email.value,
                    senha: user.senha.value,
                    telefone: user.telefone.value,
                    data_nasc: user.data_nasc.value
                })
                .then(({ data }) => toast.sucess(data))
                .catch(({ data }) => toast.error((data))); 
        } else {
            await axios
                .post("http://localhost:8800", {
                    nome: user.nome.value,
                    email: user.email.value,
                    senha: user.senha.value,
                    telefone: user.telefone.value,
                    data_nasc: user.data_nasc.value
                })
                .then(({ data }) => toast.sucess(data))
                .catch(({ data }) => toast.error(data)); 
        }

        user.nome.value = "";    //Limpando os campos
        user.email.value = "";
        user.senha.value = "";
        user.telefone.value = "";
        user.data_nasc.value = "";

        setOnEdit(null);
        getUsers();
    };

    return (
        <FormContainer ref={ref} onSubmit={handleSubmit} >
            <InputArea>
                <Label>Nome</Label>
                <Input name="Nome" />
            </InputArea>
            <InputArea>
                <Label>E-mail</Label>
                <Input name="email" type="email" />
            </InputArea>
            <InputArea>
                <Label>Senha</Label>
                <Input name="senha" type="password" />
            </InputArea>
            <InputArea>
                <Label>Telefone</Label>
                <Input name="telefone" />
            </InputArea>
            <InputArea>
                <Label>Data de Nascimento</Label>
                <Input name="data_nasc" type="date" />
            </InputArea>

            <Button type="submit">SALVAR</Button>
        </FormContainer>
    );
}

export default Form;
